Information
------------------------------

The Zoo Next Door
With over 70 million pets at home, Britain is a nation of animal lovers. The Zoo Next Door features people who've taken animal ownership to extremes.
Jasmine Harman has previously helped hoarders to take their lives in hand but in this film she meets animal fanatics who've virtually given up their lives for their animals. Jasmine, who's mad about dogs, brings the animal welfare experts in when change is needed but finds out that even with extreme numbers, some owners wouldn't change a thing.

